  [],\n\t\"revision_timestamp\": \"2016-06-07T02:04:28.764040\",\n\t\"name\": \"nefsc-2004-winter-bottom-trawl-survey-al0401-ek500\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The NEFSC bottom trawl survey is a fisheries
  independent, multi-species survey that provides the primary scientific data for
  fisheries assessments in the U.S. mid-Atlantic and New England regions. Two bottom
  trawl surveys are conducted each year, one in the spring and one in the autumn.
  The survey is a standardized, stratified random design, with stratification based
  on bathymetry and multiple trawl sites within each stratum. Trawl sites are selected
  randomly, but the overall ship path is south to north. The survey covers the continental
  shelf and U.S. exclusive economic zone (EEZ) from Cape Hatteras, North Carolina
  into the Canadian EEZ. The primary gear is a bottom trawl, with CTD, multifrequency
  echosounder, and a host of other scientific sensor data collected ancillary to the
  bottom trawl catches.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
